from telethon import TelegramClient, events, Button
import asyncio
import re

# ============ CONFIGURATION =============

# Use your string session here (from your generated file)
STRING_SESSION = ""

# Your API ID and HASH from my.telegram.org
API_ID = 29676661
API_HASH = '1b8fb46782cc52ced8510087c12859b3'

# Pocket Option bot username (the bot to forward ID and check reply)
POCKET_BOT_USERNAME = '@AffiliatePocketBot'  # Change to actual username with @ removed

# Your Telegram user ID to receive Pocket Option ID and responses (for admin)
ADMIN_USER_ID = 7765768262  # your Telegram numeric user ID

# One-time join group link (expires after use, you can regenerate on your own)
ONE_TIME_GROUP_LINK = "https://t.me/+EgEgmWaKnQA1OTA8"

# Minimum balance required in USD
MIN_BALANCE = 50

# Custom message when "user not found"
USER_NOT_FOUND_MESSAGE = "Sorry, your Pocket Option ID was not found. Please check and try again."

# Custom message when duplicate ID detected
DUPLICATE_ID_MESSAGE = "This Pocket Option ID is already registered."

# ========================================

client = TelegramClient('bot', API_ID, API_HASH, session=STRING_SESSION)

# Store user Pocket Option IDs to prevent duplicates (in-memory, change to DB for production)
user_id_map = {}

# Helper function to extract balance from Pocket Option bot reply text
def extract_balance(text):
    # Example text contains "Balance: $123.45"
    match = re.search(r'Balance: \$([\d\.]+)', text)
    if match:
        return float(match.group(1))
    return 0

@client.on(events.NewMessage(pattern='/start'))
async def start(event):
    sender = await event.get_sender()
    await event.respond(
        "👋 Welcome! Please join our official channel before proceeding.",
        buttons=[
            Button.url("✅ Join Channel", "https://t.me/your_channel_here")
        ]
    )
    # After this, you expect user to send Pocket Option ID next
    # Optionally you can set a state tracker if you want

@client.on(events.NewMessage)
async def handle_pocket_id(event):
    user_id = event.sender_id
    text = event.raw_text.strip()

    # Basic check if text looks like Pocket Option ID (customize this check)
    if not text.isdigit():
        return  # Ignore non-numeric messages

    # Check duplicate
    if user_id in user_id_map and user_id_map[user_id] == text:
        await event.respond(DUPLICATE_ID_MESSAGE)
        return

    # Forward ID to Pocket Option bot
    try:
        # Send ID to Pocket Option bot and wait for reply
        async with client.conversation(POCKET_BOT_USERNAME, timeout=30) as conv:
            await conv.send_message(text)
            response = await conv.get_response()

            response_text = response.raw_text

            if "user not found" in response_text.lower():
                await event.respond(USER_NOT_FOUND_MESSAGE)
                return

            balance = extract_balance(response_text)
            if balance >= MIN_BALANCE:
                await event.respond(
                    f"✅ Your balance is ${balance:.2f}. Here is your one-time join link:\n{ONE_TIME_GROUP_LINK}"
                )
                # Save user ID and PO ID to prevent duplicate use
                user_id_map[user_id] = text
            else:
                await event.respond(f"Your balance is ${balance:.2f}. Minimum $50 required.")
    except Exception as e:
        await event.respond("⚠️ Error verifying Pocket Option ID, please try again later.")
        print(f"Error in conversation: {e}")

async def main():
    print("Bot is starting...")
    await client.start()
    print("Bot started!")
    await client.run_until_disconnected()

if __name__ == '__main__':
    asyncio.run(main())
